import React,{ useState }  from "react";
import { Link,Route,BrowserRouter as Router } from "react-router-dom";
import logo from "../assets/logo.png";
import { Menu, MenuItem, Button } from "@material-ui/core";

const [openMenu, setOpenMenu] = useState(null);
const HandleMenu = () => {
  setOpenMenu(true);
};
const closeMenu = () => {
  setOpenMenu(false);
};

const HeaderAdmon = () => {
  return (
    <div className="HomeContainer ">
      <div className="menu">
        <box-icon name="menu"></box-icon>
      </div>
      <Link to="/">
        <div className="logo">
          <img src={logo} alt="P-WorkFlow" width="200" />
        </div>
      </Link>
      <Router>
        <Button onClick={HandleMenu}>Proyecto</Button>
        <Menu open={openMenu} onClose={closeMenu}>
          <MenuItem onClick={closeMenu}><Link to="/Proyect">Crear Proyecto</Link></MenuItem>
          <MenuItem onClick={closeMenu}>Lista proyecto</MenuItem>
        </Menu>
      </Router>

      <ul>
        <li>
          <Link to="/Prueba">Cerrar Sesion</Link>
        </li>

        <li>
          <Link to="/Proyect">Crear Proyecto</Link>
        </li>
        <li>
          <Link to="/CreateUser">Crear Usuarios</Link>
        </li>
      </ul>
    </div>
  );
};
export default HeaderAdmon;
